from itertools import count, islice
def is_subseq(s, p):
    while s and p:
        if p%10 == s%10: s //= 10
        p //= 10
    return s == 0
def agen(): # generator of terms
    an2, an1 = [1, 3]
    yield from [an2, an1]
    while True:
        an = next(i*an1 for i in count(1) if is_subseq(an2, i*an1))
        an2, an1 = an1, an
        yield an
